import React, { forwardRef } from "react";
import style from "./style.module.scss";

const InputHandler = ({
  type = "text",
  className,
  onChange,
  placeholder = "",
  value,
}) => {
  return (
    <input
      type={type}
      className={`${style["input"]} ${className}`}
      onChange={onChange}
      placeholder={placeholder}
      value={value}
    />
  );
};

export default InputHandler;
